about book :-

The purpose of this book is to systematize the knowledge necessary to make Cardiopulmonary Resuscitation (CPR) or Cardiorespiratory Resuscitation (CRR) known to nursing health specialists, which translates as a set of temporary and internationally standardized maneuvers assigned to ensure the oxygenation of the vital organs when the blood circulation of an individual stops suddenly, independently of the cause of the Cardiorespiratory arrest (CRA).

